num = "0.2" Note: Since the serde feature is not enabled on third party crates in the Rust Playground by default, the code examples in this article are not interactive. We will show the program output in the text. You can run these examples from this cargo project . The example below shows how to serialize and deserialize a BigInt struct type from the num_bigint crate. It just works out of the box. use num::bigint::ToBigInt;
use num_bigint::BigInt; fn main() { let a = 3.to_bigint().unwrap(); let x = num::pow(a, 247); let xs = serde_json::to_string(&x).unwrap(); let xd: BigInt = serde_json::from_str(&xs).unwrap(); assert_eq!(x, xd); println!("3**247 is {} and serializes to {}", x, xs);
