To get a random number, you can simply do the following. # extern crate rand; fn main() { let i: i32 = rand::random(); println!("The random i32 is {}", i);
} The random() is smart enough to know the primitive type it is supposed to generate. Check out the example below. # extern crate rand; fn main() { let x: u8 = rand::random(); println!("The random u8 is {}", x); let x: f64 = rand::random(); println!("The random f64 is {}", x); let x:bool = rand::random(); println!("The random bool {}", x);
} What about generating a random number within a range? For that, you need to create a random number generator and call its gen_range() function. # extern crate rand; use rand::thread_rng;
use rand::Rng; fn main() { let mut rng = thread_rng(); let y: f64 = rng.gen_range(-10.0, 10.0); println!("Number from -10. to 10.: {}", y); println!("Number from 0 to 9: {}", rng.gen_range(0, 10));
}

