In order to get a series of random numbers, you could call the random() function multiple times. But that is slow since every time it needs to instantiate and seed a new random number generator. It is faster to create the generator once and call its gen() function repeatedly. # extern crate rand; use rand::thread_rng;
use rand::Rng; fn main() { let mut rng = thread_rng(); for i in 1..10 { println!("Random number #{}: {}", i, rng.gen_range(0, 100)); }
} The generator can quickly fill an array with random integers. # extern crate rand; use rand::thread_rng;
use rand::Rng; fn main() { let mut arr = [0i32; 9]; thread_rng().try_fill(&mut arr[..]); println!("Random number array {:?}", arr);
} Another neat feature of the generator is that it can generate random numbers from a probability distribution. # extern crate rand; use rand::thread_rng;
use rand::Rng; fn main() { let mut rng = thread_rng(); let distr = rand::distributions::Uniform::new_inclusive(1, 100); let mut nums = [0i32; 3]; for x in &mut nums { *x = rng.sample(distr); } println!("Some numbers: {:?}", nums);
}
